import { Button } from '@material-ui/core';
import React from 'react';
import '../../styles/Header.css';
import history from './../../misc/history';
import LoginService from '../../services/login.service';

function Header() {

    return (
        <div className="Header">
            <header>
                <h1 className="App">Humanitarni šetači pasa</h1>
                <Button className="btn" onClick={() => history.push("/")}>Home</Button>
                <Button className="btn">Statistika</Button>
                <Button className="btn">Raspored</Button>
                <Button className="btn">O nama</Button>
                { LoginService.isLoggedIn() ? (
                    <>
                        <Button className="btn" >Profil</Button>
                        <Button className="btn" onClick={() => LoginService.logout()}>Logout</Button>
                    </>
                ) : (
                    <>
                        <Button className="btn" onClick={() => history.push("/registration")}>Registracija</Button>
                        <Button className="btn" onClick={() => history.push("/login")}>Login</Button>
                    </>
                )}
            </header>
        </div>
    );
}

export default Header;
